import React from "react";
import books from "./dummyBooks.json";
import "./Discover.css";
import DiscoverCarousel from "./DiscoverCarousel";


const Discover = () => {
    return (
        <div className="mt-4">
            <h1>Discover</h1>
            <div className="row">
                <DiscoverCarousel books={books}/>
            </div>
        </div>
    )
}

export default Discover;
